/*以課本(碁峯) P3-26的演算法，列出 <=n 的所有質數 。2<=n<=100000
以 n=25 為例
data:image/png;base64,
不使用餘除(%)運算 */
#include<iostream>
#include<list>
using namespace std;
int main(){
    int i,j,n;
    cin>>n;
    list<int> a;
    for(i=0;i<n-1;i++){
        a.push_back(2+i);
    }
    for(i=2;i<n;i++){
        for(j=2;j<n;j++){
            if (i*j>n){
                break;
            }
            a.remove(i*j);
        }
    }
    for(auto itr=a.begin();itr!=a.end();itr++){
        cout<<*itr<<" ";
    }
}
